import React from "react";
import { useState } from "react";
import './ForgotPassword.css';

const ForgotPassword = () => {
    const [email, setEmail] = useState("");

  return (
    <div className="forgot-password-container">
        <div className='forgot-password-logo-name'>
          <a href='/home'>MentUp</a>
        </div>
        <div className='forgot-password-box'></div>
        <h1>Şifreni Değiştir</h1>
        <h2>E-postanızı yazın, size şifrenizi sıfırlamanız için bir bağlantı göderelim</h2>
      <form>
        <div className="forgot-password-form-group">
          <label htmlFor="email">E-posta</label>
          <input 
            type="email"
            id="email"
            value={email} onChange={(e) => setEmail(e.target.value)}
            placeholder="E-posta adresinizi girin"
            required
          ></input>
        </div>
        <button type="submit" className="forgot-password-reset-button">Şifreyi Sıfırla</button>
      </form>
    </div>
  );
};

export default ForgotPassword;
